        <form
          method="POST"
          enctype="multipart/form-data"
          action="uploaddufichier"
        >
          <input type="file" name="monfichier" accept="image/png" multiple />
          <button> envoyer </button>
        </form>
      </div>
    );
  }
}

export default App;
